import React from 'react';
import s from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = () => {
	return (
		<div className={s.posts}>
			My Posts
			<button>New Post</button>
			<Post message="Hi, h r u" />
			<Post message="y'oyoyoy" />
		</div>
	);
};

export default MyPosts;
